import datetime
import logging

class SubmissionManager:
    def __init__(self):
        self.submissions = {}
        self.status_log = {}

    def delete_submissions_on_date(self, date):
        """Delete submissions on a specific date."""
        date_str = date.strftime('%Y-%m-%d')
        to_delete = [key for key, submission in self.submissions.items() if submission['date'] == date_str]
        for key in to_delete:
            del self.submissions[key]
            logging.info(f"Deleted submission: {key}")

    def log_submission_status(self, submission_id, status):
        """Log the status of submissions."""
        if submission_id not in self.status_log:
            self.status_log[submission_id] = []
        self.status_log[submission_id].append({
            'timestamp': datetime.datetime.now(),
            'status': status
        })

    def update_submission_status(self, submission_id, new_status):
        """Update the status of a submission."""
        if submission_id in self.submissions:
            self.submissions[submission_id]['status'] = new_status
            self.log_submission_status(submission_id, new_status)
            logging.info(f"Updated submission {submission_id} to status: {new_status}")
        else:
            logging.warning(f"Submission {submission_id} not found.")


