class ValidationManager:
    def validate_uploaded_file(self, file_name, allowed_formats):
        """Validate uploaded files against allowed formats."""
        if not any(file_name.endswith(fmt) for fmt in allowed_formats):
            logging.error(f"Invalid file format for: {file_name}")
            return False
        logging.info(f"File {file_name} is valid.")
        return True

    def validate_duns_number(self, duns_number):
        """Validate a DUNS number."""
        if len(duns_number) == 9 and duns_number.isdigit():
            logging.info(f"DUNS number {duns_number} is valid.")
            return True
        logging.error(f"Invalid DUNS number: {duns_number}")
        return False


class DataPublisher:
    def __init__(self):
        self.published_data = set()

    def publish_data_record(self, data_record):
        """Publish data records if not already published."""
        if data_record['id'] in self.published_data:
            logging.warning(f"Data record {data_record['id']} has already been published.")
            return False
        self.published_data.add(data_record['id'])
        logging.info(f"Published data record: {data_record['id']}")
        return True


class FlexFieldManager:
    MAX_FLEXFIELDS = 10

    def __init__(self):
        self.flexfields = []

    def add_flexfield(self, flexfield):
        """Add a flexfield if under the limit."""
        if len(self.flexfields) < self.MAX_FLEXFIELDS:
            self.flexfields.append(flexfield)
            logging.info(f"Added flexfield: {flexfield}")
            return True
        logging.error("Cannot add flexfield: limit reached.")
        return False
